import { useEffect,useState } from 'react';

const Effect = () => {
    let[data,setValue]=useState("use effect hooked")
    useEffect(()=>{
       let fetchData= async()=>{
        let response=await fetch(" http://localhost:1000/users")
        let data=await response.json()
        console.log( data);
       }
       fetchData()
    },[])
    return ( 
        <div className="effect">
            <h1>{data}</h1>
            <button onClick={()=>setValue("updated")}>Modify</button>
        </div>
     );
}
 
export default Effect;
